import { useState } from "react";
import classes from "./CheckStatusMainFrame.module.css";

function CheckStatusMainFrame() {
    const [isTraining, setIsTraining] = useState(true);

    return (
        <div>
            <img />
            <div>
                <img />
                <div>姓名 : </div>
                <div>開始時間 : </div>
                {isTraining ? (
                    <div>狀態 : 訓練中</div>
                ) : (
                    <div>狀態 : 訓練成功</div>
                )}
                {!isTraining ? (
                    <div></div>
                ) : (
                    <div>已自動新增至聊天對象</div>
                )}
            </div>
            <img />
        </div>
    );
}

export default CheckStatusMainFrame;
